import * as ActionTypes from './Types';
import { useDispatch  } from 'react-redux';

const defaultAuthState = {
  type: ActionTypes.LOGIN_DEFAULT
}

const logOutAction = () => {
  const dispatch = useDispatch();
  return dispatch(defaultAuthState);
}

export default log
